import{_ as a,c as t,o as s,ag as n}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"ALTER TABLESPACE","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/ALTER_TABLESPACE.md","filePath":"docs/7x/ref_guide/sql_commands/ALTER_TABLESPACE.md"}'),o={name:"docs/7x/ref_guide/sql_commands/ALTER_TABLESPACE.md"};function i(l,e,p,c,r,d){return s(),t("div",null,e[0]||(e[0]=[n(`<h1 id="alter-tablespace" tabindex="-1">ALTER TABLESPACE <a class="header-anchor" href="#alter-tablespace" aria-label="Permalink to &quot;ALTER TABLESPACE&quot;">​</a></h1><p>Changes the definition of a tablespace.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER TABLESPACE &lt;name&gt; RENAME TO &lt;new_name&gt;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER TABLESPACE &lt;name&gt; OWNER TO { &lt;new_owner&gt; | CURRENT_USER | SESSION_USER }</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER TABLESPACE &lt;name&gt; SET ( &lt;tablespace_option&gt; = &lt;value&gt; [, ... ] )</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER TABLESPACE &lt;name&gt; RESET ( &lt;tablespace_option&gt; [, ... ] )</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>ALTER TABLESPACE</code> changes the definition of a tablespace.</p><p>You must own the tablespace to use <code>ALTER TABLESPACE</code>. To alter the owner, you must also be a direct or indirect member of the new owning role. (Note that superusers have these privileges automatically.)</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>name : The name of an existing tablespace.</p><p>new_name : The new name of the tablespace. The new name cannot begin with <code>pg_</code> or <code>gp_ </code>(reserved for system tablespaces).</p><p>new_owner : The new owner of the tablespace.</p><p>tablespace_parameter : A tablespace parameter to set or reset. Currently, the only available parameters are <code>seq_page_cost</code> and <code>random_page_cost</code>. Setting either value for a particular tablespace will override the planner&#39;s usual estimate of the cost of reading pages from tables in that tablespace, as established by the configuration parameters of the same name (see <a href="./../config_params/guc-list.html#seq_page_cost">seq_page_cost</a>, <a href="./../config_params/guc-list.html#random_page_cost">random_page_cost</a>). This may be useful if one tablespace is located on a disk which is faster or slower than the remainder of the I/O subsystem.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Rename tablespace <code>index_space</code> to <code>fast_raid</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER TABLESPACE index_space RENAME TO fast_raid;</span></span></code></pre></div><p>Change the owner of tablespace <code>index_space</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER TABLESPACE index_space OWNER TO mary;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>There is no <code>ALTER TABLESPACE</code> statement in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_TABLESPACE.html">CREATE TABLESPACE</a>, <a href="./DROP_TABLESPACE.html">DROP TABLESPACE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,22)]))}const E=a(o,[["render",i]]);export{m as __pageData,E as default};
